import { Fragment } from "react";
import QuoteItem from "../components/quotes/QuoteItem";

const Dummy_Quotes = [
    {id:'q1', author:"Himanshu", text:"Learn More Gain More..!!"},
    {id:'q2', author:"Mukko", text:"It's Good to be Selfish..!!"},
]

const AllQuote = () => {
    return <Fragment>
        <QuoteItem quote={Dummy_Quotes}/>
    </Fragment>
}

export default AllQuote;
